func appendCountry(name:String,phoneCode:String,code:String,strBase64:String!) -> Void {
    let decodedimage = base64ToImage(strBase64)
    countries.append(SwiftUIPhonePickerCountryModel(code: code, name: name,
                                  phoneCode: phoneCode,flag: decodedimage!))
    }
    func base64ToImage(_ base64String: String) -> UIImage? {
          guard let imageData = Data(base64Encoded: base64String) else { return nil }
          return UIImage(data: imageData)
      }
}
